INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Febre', 'Elevação da temperatura corporal acima de um valor normal, estabelecido entre 36,7ºC e 37ºC, quando medida na boca.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Tosse', 'Expulsão súbita e ruidosa de ar pela boca, visando, habitualmente, à eliminação de matéria estranha nas vias aéreas.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Dor de Garganta', 'É a dor resultante da inflamação das amígdalas (tonsilite) ou da faringe (faringite). Esta situação pode ocorrer por causas diversas, dentre elas a alérgica, a viral, a bacteriana e a traumática.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Dispneia', 'Sensação subjetiva de falta de ar.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Desconforto Respiratório', 'teste');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Diarréia', 'Aumento do volume, frequência ou quantidade de líquido nas evacuações. Deve ser a manifestação mais frequente de alteração da absorção ou transporte intestinal de substâncias, alterações estas que em geral são devidas a uma infecção bacteriana ou viral, a toxinas alimentares, etc.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Vômito', 'Ação de vomitar; emissão violenta, pela boca, de conteúdo gástrico, por contração do diafragma e da musculatura do estômago.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Dor Abdominal', 'Dor abdominal é aquela sentida em qualquer região entre o tórax e a virilha. Essa área é popularmente conhecida como barriga.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Fadiga', 'Cansaço; estado que vem após o trabalho excessivo ou atividade exagerada de um órgão ou de um organismo.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Perda de Olfato', 'É a perda parcial ou completa do sentido. Costuma estar diretamente ligada com a perda do paladar.');
INSERT INTO Sintomas (NomeSintoma, Descricao) VALUES ('Perda de Paladar', 'É a perda parcial ou completa do sentido. Costuma estar diretamente ligada com a perda do olfato.');
